dynamic size, unlike array. // Interface IComparable<T> uses CompareTo() to compare > 2 objects. internal class Buch : IComparable<Buch>{ public string Titel { get; set; } public double Preis { get; set; } public uint Jahr { get; set; } public Buch(string titel, double preis, uint jahr){ Titel = titel; Preis = preis; Jahr = jahr; } public override string ToString(){ return $"Titel: {Titel}
Preis: {Preis}
Jahr: {Jahr}
Genre: {Genre}
"; } public override bool Equals(object other){ if (other is Buch){ Buch o = (Buch)other; return Titel == o.Titel && Preis == o.Preis && Jahr == o.Jahr && Genre == o.Genre; } return base.Equals(other); } // IComparable<T> Interface erlaubt es direkt 2 Einträge zu vergleichen und damit direkt 'list.Sort()' aufzurufen. /// -1 -> other vor this /// ==0 -> other same priority as this /// +1 -> this comes first then other public int CompareTo(Buch other){ // Größter Preis zuerst: return -this.Preis.CompareTo(other.Preis); // Kleinster Preis zuerst: return this.Preis.CompareTo(other.Preis); // Alphabetisch sortiert: return this.Titel.CompareTo(other.Titel); } } // IComparer : Diese Klasse ist die zweite Möglichkeit zu vergleichen. Mithilfe einer externen Klasse vom Typ IComparer<T> // - hier könnte für jedes Sortierfuntkion (nachTitel, nachPreis etc) eine gesonderte Sortierfunktion erstellt werden // - hier wird die SortPreis klasse an die Sort Methode übergeben: 'list.Sort(new SortPreis())' internal class SortPreis : IComparer<Buch>{ public int Compare(Buch x, Buch y){ return x.Preis.CompareTo(y.Preis); // aufsteigende Sortierung nach Preis } } internal class Programm{ static void Main(){ List<Buch> list = new List<Buch>(); list.Add(new Buch("Der rote Luftballon", 49.99, 2020)); list.Add(new Buch("Blumen im Sommerwind", 39.99, 2019)); list.Add(new Buch("Und der Rabe lacht", 89.99, 2021)); list.Add(new Buch("Von Gärtnern und Mördern", 79.89, 2018)); list.Add(new Buch("Blumen im Sommerwind", 39.99, 2019)); // .Remove(), .BinarySearch() ... benutzt die object.Equals() methode. Um nicht nur die objekt pointer zu vergleichen überschreiben wir sie in der Klasse Buch Buch vgl = new Buch("Und der Rabe lacht", 89.99, 2021); int idx = list.BinarySearch(vgl); bool succ = list.Remove(vgl); // .Sort() benötigt das ICompare Interface und damit die CompareTo() Methode direkt in der Klasse Buch list.Sort(); foreach (Buch b in list) Console.WriteLine(b); // Alternativ übergeben wir eine Sortierer-Klasse an .Sort(new sortierer): list.Sort(new SortPreis()); foreach (Buch b in list) Console.WriteLine(b); } }
